h1 {
  margin: 0;
  font-size: 3em;
  font-weight: 900;
  line-height: 1.25em;
}

h2 {
  font-weight: 500;
}

p,
li {
  font-weight: 300;
  color: #aaa;
  font-size: 0.75em;
  line-height: 1.5em;
}

a {
  text-transform: uppercase;
  text-decoration: none;
  font-weight: 900;
  font-size: 0.75em;
  color: #6EC6B1;
  line-height: 1.5em;
  transition: 0.2s;
}
a:hover {
  transition: 0.2s;
  color: #49b89d;
}

.resume-container {
  display: flex;
  flex-direction: column;
  padding: 24px;
  align-items: center;
  background: #6EC6B1;
}
@media (max-width: 768px) {
  .resume-container {
    padding: 12px;
  }
}
.resume-container h3,
.resume-container h4,
.resume-container p {
  margin: 0;
}
.resume-container h2 {
  padding-bottom: 6px;
  border-bottom: 1px solid #6EC6B1;
}
.resume-container h3 {
  margin-bottom: 12px;
}
.resume-container h4 {
  font-weight: 500;
}
.resume-container p,
.resume-container li {
  color: #333;
  font-size: 0.825em;
  line-height: 1.75em;
}
.resume-container .resume {
  display: flex;
  flex-direction: column;
  padding: 0px;
  padding: 48px 72px;
  background: #fff;
  box-shadow: 0 4px 12px rgba(51, 51, 51, 0.2);
  max-width: 768px;
  border-radius: 12px;
}
.resume-container .resume > :not(:last-child) {
  margin-bottom: 12px;
}
@media (max-width: 768px) {
  .resume-container .resume {
    padding: 48px 36px;
  }
}
.resume-container .resume-header {
  display: flex;
  flex-direction: column;
  padding: 0px;
}
.resume-container .resume-header > :not(:last-child) {
  margin-bottom: 12px;
}
.resume-container section {
  display: flex;
  flex-direction: column;
  padding: 0px;
}
.resume-container section > :not(:last-child) {
  margin-bottom: 18px;
}
.resume-container header {
  display: flex;
  flex-direction: column;
  padding: 0px;
}
.resume-container header > :not(:last-child) {
  margin-bottom: 6px;
}
.resume-container article {
  display: flex;
  flex-direction: column;
  padding: 0px;
}
.resume-container article > :not(:last-child) {
  margin-bottom: 12px;
}
.resume-container .job-summary {
  display: flex;
  flex-direction: column;
  padding: 0px;
}
.resume-container .job-summary > :not(:last-child) {
  margin-bottom: 9px;
}
.resume-container .job-details {
  color: #aaa;
  font-size: 0.825em;
}
